sources.styles/blocks/page.scss:
.page {
  font-family: Cinzel, serif;
  font-style: normal;
  font-size: 16px;
  line-height: 27px;
  scroll-behavior: smooth;
  color: $main-color;

  &__body {
    margin: 0;

    &--menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(100%);
    transition: transform $duration;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 100px;
    @include onDesktop {
      margin-bottom: 140px;
    }
  }

  &__section-title {
    font-weight: 700;
    font-size: 32px;
    line-height: 32px;
    text-align: center;
    letter-spacing: -1.5px;
    margin: 0;

    &--about {
      text-align: left;
      margin-bottom: 32px;
    }
    &--explore {
      margin-bottom: 48px;
    }
    &--contacts {
      margin-bottom: 48px;
    }
    @include onDesktop {
      font-size: 48px;
      line-height: 48px;
    }
  }
}

sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
    column-gap: 24px;
  }

  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
    column-gap: 24px;
  }

  &--mobile {
    @media (max-width: 744px) {
      grid-template-columns: repeat(3, 1fr);
      column-gap: 8px;
    }
  }

  &__item {
    &--hidden {
      @include onTablet {
        display: none;
      }
      @include onDesktop {
        display: block;
      }
    }

    @for $start from 1 through 2 {
      @for $end from $start through 2 {
        &--mobile-#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }
      }
    }

    @for $start from 1 through 6 {
      @for $end from $start through 6 {
        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }

    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }
  }
}

sources.styles/blocks/header.scss:
.header {
  width: 100%;
  height: 100vh;
  padding: $headerTopPadding 0;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url(../images/background.svg);

  &__content {
    display: grid;
    gap: 130px;
    grid-template-rows: 1fr 2fr;

    @include onTablet {
      grid-template-rows: 1fr 3fr;
      gap: 140px;
    }

    @include onDesktop {
      grid-template-rows: 1fr 3fr;
      gap: 84px;
    }
  }

  &__top {
    display: grid;
    grid-template-columns: 1fr 24px 24px;
    justify-content: space-between;
    gap: 30px;
    align-items: center;

    @include onDesktop {
      grid-template-columns: 1fr 32px 32px;
      gap: 64px;
    }
  }

  &__title {
    font-weight: 700;
    font-size: 40px;
    line-height: 40px;
    margin: 0 auto;
    text-align: center;
    color: #fff;
    letter-spacing: -1.5px;

    @include onTablet {
      font-size: 64px;
      line-height: 64px;
    }
    @include  onDesktop {
      font-size: 80px;
      line-height: 80px;
    }
  }

  @include onDesktop {
    padding-top: $headerTopDesctopPadding;
  }
}

