sources.styles/blocks/icon.scss:
.icon {
  --icon-size: 24px;
  position: relative;
  display: block;
  width: var(--icon-size);
  height: var(--icon-size);
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  text-decoration: none;
  @include onTablet {
    --icon-size: 32px;
  }
  @include  onDesktop {
    --icon-size: 32px;
  }

  &__tooltip {
    position: absolute;
    display: block;
    right: 100%;
    top: 50%;
    color: #fff;
    width: max-content;
    transform: translateY(-50%);
    padding-right: 16px;
    font-weight: 700;
    text-shadow: 18px 4px 26px rgba(0, 0, 0, 0.44);
    text-transform: uppercase;
    opacity: 0;
    pointer-events: none;
    text-align: right;
    transition: opacity $duration;
  }

  &:hover &__tooltip {
    opacity: 1;
    pointer-events: all;
  }

  &--menu {
    background-image: url(../images/menu.svg);

    &:hover {
      background-image: url(../images/menu-hover.svg);
    }
  }

  &--call {
    background-image: url(../images/call.svg);
  }

  &--cross {
    background-image: url(../images/close.svg);
  }
}

sources.styles/blocks/menu.scss:
.menu {
  background-color: $accent-color;
  z-index: 1;
  &__content {
    height: 100vh;
    padding-top: $headerTopPadding;
    @include onDesktop {
      padding-top: $headerTopDesctopPadding;
    }
  }

  &__top {
    display: grid;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 40px;
    grid-template-columns: 1fr 24px;
    @include  onTablet {
      grid-template-columns: 1fr 32px;
    }
    @include  onDesktop {
      grid-template-columns: 1fr 32px;
    }
  }

  &__list {
    list-style: none;
    margin: 0;
    padding: 0;
  }

  &__item {
    width: max-content;
    text-transform: uppercase;
    font-weight: 700;
    font-size: 22px;
    line-height: 22px;
    align-items: center;
    letter-spacing: 2px;
    padding-bottom: 8px;
    margin-bottom: 24px;
    color: #fff;
    border-bottom: 1px solid transparent;
    transition: border-color $duration;

    @include onDesktop {
      &:hover {
        border-color: #fff;
      }
    }
  }

  &__link {
    text-decoration: none;
    color: #fff;
  }

  &__call {
    display: block;
    width: max-content;
    text-decoration: none;
    color: #fff;
    font-weight: 700;
    font-size: 16px;
    line-height: 27px;
    text-transform: uppercase;
    margin-bottom: 8px;
    transition: border-color $duration, transform $duration;

    &:hover {
      border-color: #fff;
      transform: scale(105%);
    }

    &:last-child {
      margin-top: 8px;
      font-size: 12px;
      line-height: 26px;
      letter-spacing: 2px;
      border-bottom: 1px solid transparent;
      padding-bottom: 8px;
      transition: border-color 0.3s, transform 0.3s;
      &:hover {
        border-color: #fff;
        transform: scale(105%);
      }
    }
  }
}

