sources.styles/blocks/exhibition.scss:
.exhibition {
  margin-bottom: 48px;
  &:last-child {
    margin-bottom: 40px;
  }

  &__photo-container {
    position: relative;
    width: 100%;
    max-height: 320px;
    margin-bottom: 24px;
    overflow: hidden;
    transition: transform $duration;
    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    &:hover {
      transform: scale(105%);
    }

    &--old {
      @include onTablet {
        height: 186px;
      }
    }

    &--disney {
      @include onTablet {
        height: 186px;
      }
    }

    @include onDesktop {
      height: 320px;
      padding-bottom: 0;
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;
    object-fit: cover;
    object-position: center;
  }

  &__link {
    color: $accent-color;
    font-weight: 700;
    text-decoration: none;
  }
}
